import React, { Component } from 'react'
import Box from '../components/Box'

export default class Login extends Component {
    render() {
        return (
            <div className="login">
                <Box extraClass="login-box">
                    <h1 style={{
                        margin: '20px',
                        fontSize: '40px',
                        fontFamily: 'Inter, Oxygen, sans-serif'
                    }}>IUBConnect</h1>
                    <form>
                        <input className="login-field" placeholder="Username" type="text"></input>
                        <input className="login-field" placeholder="Password" type="text"></input>
                        <button className="login-button">Log In</button>
                    </form>
                    <span style={{margin: '10px'}}>Don't have an account?</span>
                </Box>
            </div>
        )
    }
}
